import { Route, Routes } from "react-router";

import { MobileNumber } from "../components/Login/mobilenumber";

export const Routing = () => {
    

    return (
        <div>
            <Routes>
                <Route path="/login" > <MobileNumber/></Route>
          </Routes>
        </div>
    )
}
